import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div className="row">
        <div className="col-*-4">
          <button
            className="btn btn-primary"
            style={{ margin: 10, width: 400 }}
            onClick={() => {
              "asd";
            }}
          >
            <h4>Download New Public Events</h4>
          </button>
        </div>
        <div className="col-*-4">
          <button
            className="btn btn-primary"
            style={{ margin: 10, width: "95%" }}
            onClick={() => {
              "asd";
            }}
          >
            <h4>Fetch Events by Repo Names</h4>
          </button>
        </div>
        <div className="col-*-4">
          <button
            className="btn btn-primary"
            style={{ margin: 10, width: "95%" }}
            onClick={() => {
              "asd";
            }}
          >
            <h4>Fetch Events by Date</h4>
          </button>
        </div>
      </div>
    );
  }
}
export default Home;
